import React, { useEffect, useState } from 'react'
import { useNavigate } from "react-router-dom";
import {Avatar} from '@mui/material'

const Navbar = ({isLoggedin, user}) => {
  const[navbarToggle, setNabvarToggle] = useState(false)

  // useEffect(() => {
  //   console.log(user, user?.username)
  // }, [user])

  const navigate = useNavigate()
  const handleLoginNavigate=(e)=>{
    e.preventDefault()
    navigate('/login')
  }

  const avatar = isLoggedin ? <Avatar>user.username</Avatar> : <button onClick={handleLoginNavigate}>Login/Signup</button>

  const navbar_list = ['Home','About','Contact','Authors']
  console.log("user",user)
  return (
    <div className='flex items-center justify-between'>
      <div className="font-bold text-xl">
        YourLogo
      </div>
      <nav className = 'text-black p-4 flex items-center justify-between bg-transparent '>
        <div className=' flex md:flex-row flex-col items-center space-x-4 mt-4 md:mt-0'>
          {navbar_list.map((title, key)=>{
            return(
              <a href='/' key={key} className='hover:text-gray-500'> {title} </a>
            ) 
          })}
        </div>
      </nav>
      <div>{avatar}</div>
    </div>
  )
}

export default Navbar
